from collections import defaultdict

def count_k_interesting_pairs(n, k, sequence):

    def bit_count(x):
        cur = 0
        while x > 0:
            if x % 2:
                cur += 1
            x //= 2
        return cur
    A_dict = defaultdict(int)
    for i in sequence:
        A_dict[i] -= 1
    mask = []
    for i in range(2 ** 15):
        if bit_count(i) == k:
            mask.append(i)
    ans = 0
    for i in A_dict:
        for j in mask:
            if i ^ j in A_dict:
                if i ^ j == i:
                    ans += A_dict[i] * (A_dict[i] - 1)
                else:
                    ans += A_dict[i] * A_dict[i ^ j]
    return ans // 2

